import React ,{useState}from "react";
// import { Router } from 'react-router-dom';
import Navbar from "./App/Components/navbar/Navbar";
import Routing from "./App/Components/Router/Routing";
// import { Router, Routes, Route } from 'react-router-dom';
// import ProjectDetails from './App/Pages/ProjectDetailsPage/DetailsPage';
// import DetailsPage from './App/Pages/ProjectDetailsPage/DetailsPage';
// import Homepage from "./App/Pages/Homepage";
import "./App/stylesheets/base.scss";



function App() {

  const [updatedApi,setUpdatedApi] = useState("hello");
  return (
    <>
      <div className="home-main-container">
        <Navbar />
        <Routing updateApi={setUpdatedApi}/>
      </div>
    </>
  );
}

export default App;
